import React, { Component } from 'react';
import {ListItem,} from '../style'

class List extends Component{
    render() {
        return
        <ListItem>
          <img src="https://upload-images.jianshu.io/upload_images/7691404-010aff3a3646391d.png?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240"></img>
          <ListInfo>
            <h3>
              舒淇情史：与黎明相恋7年终无果，和张震约定婚期最后新娘却不是她
            </h3>
            <p></p>
          </ListInfo>
        </ListItem>;
    }
}

export default List;
